import React from "react"
import styles from "./NavBar.module.css"

const NavBar = () => {
  return (
    <div className={styles.navBar}>
      <div className={styles.logo}>timeKeep</div>

      <div className={styles.menu}></div>
    </div>
  )
}
export default NavBar
